    const [music, setMusic] = useState([]);
    useEffect(() => {
        const getData = () => {
            fetch("data.json", {
                    headers: {
                      "Content-Type": "application/json",
                      Accept: "application/json"
                    }
            })
            .then((response) => response.json())
            .then((data) => setMusic(data));

        };

getData();

}, []);


    return (
        <div>
           {music.map((m) => (
               <div key={m.id}>
               <h2>Artist: {m.artistname}</h2>
               <h2>Album: {m.album}</h2>
               <h2>Record Label: {m.label}</h2>
               </div>
           ))} 
        </div>
    )
}

